const preload=()=>{
  getCategories().then(data=>{
    if(data.error){
      console.log(data.err)
    }
    else{
      setcategory(data);
    }
  })
}



  return (
    <Base title="Welcome admin" description="Manage products here">
      <h2 className="mb-4">All products:</h2>
